import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';

import './App.css';

function App() {
  return (
     <BrowserRouter>
      <div className="App">
        <Route path="/" exact component={Home}/>
      </div>
     </BrowserRouter>
  );
}

export default App;



const Home = () => {
  return (
    <div>
      <h1>Home</h1>
    </div>
  )
}
